import React from "react";
import "./Header.module.css";
import headerBackground from "./assets/header-background.jpg";

const Header = () => {
  return (
    <header className="header" id="top" style={{ backgroundImage: `url(${headerBackground})` }}>
        <h1>
            Focused on Tax Returns, Consulting, & Business Accounting Services
        </h1>

        <button className="scheduleButton">
            Schedule a Meeting
        </button>
    </header>
  );
};

export default Header;
